(()=>{const e=document.getElementById("links"),t=document.querySelector("h1"),n={};(()=>{let o=document.createTextNode(n?.name),l=n?.links?.map((e=>`<div class="bg-${e.color}-200 px-4 py-5 w-full flex justify-between">\n        <a class="text-sm font-bold text-${e.color}-600 text-center hhover:text-${e.color}-800 cursor-pointer"\n        href="https:${e.url}" target="blank">\n        ${e.name}</a><span>librito</span></div>`)).join(""),r=document.createElement("section");r.innerHTML=l,e.appendChild(r),t.appendChild(o)})()})();